Desription:

Hillsong Church has an internationally recognized music ministry[29] with songs such as &quot;Power of Your Love&quot; by Geoff Bullock and &quot;Shout to the Lord&quot; by Darlene Zschech sung in churches worldwide.[30] Originally published as &quot;Hillsongs&quot;, Hillsong Church now produces its music through its own label, Hillsong Music Australia. Hillsong Music has released over 40 albums since 1992, many of them achieving gold status in Australia and one of them, People Just Like Us, achieving platinum status.[31] The church's 2004 live praise and worship album For All You've Done reached #1 in the mainstream Australian album charts (ARIA).[32]

Hillsong's most successful albums, the Live Album Series, have all achieved gold status in Australia and since the inception in 1992 of the annual live praise and worship albums, Hillsong has branched out and released other albums including the worship series Hillsong United, worship for kids, Christmas albums and compilation albums. The worship series began as a compilation of songs and developed into studio recorded albums. The Hillsong United series and the Hillsong United band led by Joel Houston, contains songs from the Hillsong United youth ministry. Hillsong Kids has released an annual worship for kids album since 2004. Hillsong music has released two Christmas albums, several compilation albums as well as recordings from Hillsong London, Hillsong Kiev and Youth Alive.

Geoff Bullock served as Hillsong's first worship pastor. Darlene Zschech has been Hillsong's most well-known worship leader and led Hillsong's music ministries as worship pastor from 1995 until 2008. Reuben Morgan is currently the worship pastor.


